import React from 'react';
import { StyleSheet, Button, View, SafeAreaView, Text, Separator } from 'react-native';
import Calendario from './Calendar'
//import {showLocation} from './Map'


export default class App extends React.Component {
  render() {
    return (
      <View style={styles.container}>
          <View style={styles.buttonStyle}>
              <Button
              title= 'Map'
              color= 'blue'
              fontWeight = 'bold'
              onPress = {() => alert(1)}
              />
          </View>
          <View style={styles.buttonStyle}>
              <Button
              title= 'Calendar'
              color= 'orange'
              fontWeight = 'bold'
              onPress = {() => <Calendario />}
              />
          </View>

      </View>
    );
  }
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    flexDirection: 'column',
    height: '200px',
    justifyContent: 'center',
    marginLeft: '10%',
    marginRight: '10%'
},
buttonStyle: {
    paddingBottom: '10px',
}
});
